const currentDir = path.resolve(__dirname);
//const readDir = `${currentDir}/../../packages/panvala-utils/abis`;
const readDir = currentDir;
const TokenCapacitor = JSON.parse(fs.readFileSync(`${readDir}/TokenCapacitor.json`));

// default to mainnet contracts
const tokenCapacitorAddress =
  process.env.TOKEN_CAPACITOR_ADDRESS || '0x9a7B675619d3633304134155c6c976E9b4c1cfB3';
const rpcEndpoint = process.env.RPC_ENDPOINT;

async function prepareContracts() {
  const provider = new ethers.providers.JsonRpcProvider(rpcEndpoint);
  const tokenCapacitor = new ethers.Contract(tokenCapacitorAddress, TokenCapacitor.abi, provider);

  console.log('tokenCapacitor:', tokenCapacitor.address);

  return { tokenCapacitor, provider };
}

function parseLogs(logs, tokenCapacitor) {
  return logs.map(log => ({
    log,
    event: tokenCapacitor.interface.parseLog(log),
    timestamp: ethers.utils.bigNumberify(log.timeStamp).toNumber(),
  }));
}

async function run() {
  const { provider, tokenCapacitor } = await prepareContracts();
  const events = parseLogs(etherscanResponse.result, tokenCapacitor);
  const startDay = moment.unix(events[0].timestamp).utc().startOf('day');
  
  let unlockedBalance = 0;
  const states = [];
  for (let i = 0; i < events.length; i++) {
    const { log, event, timestamp } = events[i];
    switch (event.name) {
      case 'BalancesUpdated':
        let released = event.values.unlockedBalance.sub(unlockedBalance);
        if (released.lt(0)) {
          released = ethers.utils.bigNumberify(0);
        }
        states.push({
          time: moment.unix(timestamp).utc(),
          released,
          donated: ethers.utils.bigNumberify(0),
        });
        unlockedBalance = event.values.unlockedBalance;
        break;
      case 'Donation':
        states.push({
          time: moment.unix(timestamp).utc(),
          released: ethers.utils.bigNumberify(0),
          donated: event.values.numTokens,
        });
        break;
    }
  }
  
  const dayTemplate = {
    day: null,
    released: ethers.utils.bigNumberify(0),
    donated: ethers.utils.bigNumberify(0),
  };
  let dailyChange = { ...dayTemplate, day: startDay };
  let stateIndex = 0;
  const days = [];
  while (dailyChange.day.isBefore(moment())) {
    const currentDay = stateIndex < states.length ? states[stateIndex].time.startOf('day') : moment();
    if (dailyChange.day.isBefore(currentDay)) {
      days.push(dailyChange);
      dailyChange = { ...dayTemplate, day: dailyChange.day.clone().add(1, 'days') };
      continue;
    }
    
    if (stateIndex >= states.length) {
      break;
    }
    const state = states[stateIndex];
    dailyChange.released = dailyChange.released.add(state.released);
    dailyChange.donated = dailyChange.donated.add(state.donated);
    stateIndex++;
  }
  
  const rows = days.map(day => {
    return [day.day.format('YYYY-MM-DD'), ethers.utils.formatEther(day.released), ethers.utils.formatEther(day.donated)];
  });

  const data = stringify(rows, { header: true, columns: ['Date', 'Released', 'Donated'] });
  fs.writeFileSync('token-capacitor-daily.csv', data);
}

run();
